import React from 'react';

import styled from 'styled-components';
import { Typography } from '@material-ui/core';



const Footer = () => {
    return (
        <StyledFooter>
            <Typography variant="subtitle1"> Created by Daniel Smagly </Typography>
        </StyledFooter>
    )
}

const FooterContainer = styled.div `

text-align: center;
  position: absolute;
  bottom: 0;
  width: 100% !important;
  height: 100px !important ;
  background: #6cf;

`

export default Footer;
